import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import { Router } from "./Router";

const Index = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/dashboard" element={<Dashboard />} />
      </Routes>
    </BrowserRouter>
  );
};

export default Index;
